import Button from 'react-bootstrap/Button';
import React from 'react';
import Navbar from 'react-bootstrap/Navbar';

function Footer() {
  return (
    <Navbar bg="dark" variant="dark" sticky="top" className="d-flex justify-content-center">
      <Container>
        <Col>
          <Button variant="outline-info">Top!</Button>
        </Col>
        <Col xs={6}></Col>
        <Col>
          <Navbar.Brand href="#home">Incli</Navbar.Brand>
        </Col>
      </Container>
    </Navbar>
  );
}

export default Footer;
